import Image from "./123.png";
import Image1 from "./brand.jpeg";
import './logo.css';

function Logo() {
    return (
        <div className="logo">
            <span className="brand_logo"><img src={Image} alt="logo not found" /></span>
            <span className="brand_name"> <img src={Image1} alt="brand name not found" /></span>
        </div>
    );
}

export default Logo;
